import React from "react";
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Outlet,
    Link,
    BrowserRouter, useLocation,
} from "react-router-dom";

class NavBar extends React.Component {
  render() {
    return (
      <aside className="mdc-drawer mdc-drawer--dismissible mdc-drawer--open">
        <div className="mdc-drawer__header">
          <h3 className="mdc-drawer__title">Devices Dashboard</h3>
          <h6 className="mdc-drawer__subtitle">Test</h6>
        </div>
        <div className="mdc-drawer__content">
          <div className="mdc-list">
              <Routes>
                  <Route path="/" element={<NavItems />}>
                      <Route index element={<Home />} />
                      <Route path="about" element={<About />} />
                      <Route path="dashboard" element={<Dashboard />} />
                      <Route path="*" element={<NoMatch />} />
                  </Route>
              </Routes>
            {/* Bottom Navigation */}
            <a
              className="mdc-list-item bottomTabsForNav"
              href="../API/logout.php"
            >
              <i
                className="material-icons mdc-list-item__graphic"
                aria-hidden="true"
              >
                logout
              </i>
              <span className="mdc-list-item__text">Logout</span>
            </a>
          </div>
        </div>
      </aside>
    );
  }
}

class NavBarItem extends React.Component {
  render() {
    return (
      <div className="mdc-list-item" aria-current="page">
        <i className="material-icons mdc-list-item__graphic" aria-hidden="true">
          {this.props.icon}
        </i>
        <span className="mdc-list-item__text"> {this.props.name} </span>
      </div>
    );
  }
}

function NavItems() {
    return (
        <div>
            <Link to="/">dfd
                <NavBarItem name={"Home"} icon={"home"} />
            </Link>
            <Link to="/f">f
                <NavBarItem name={"Devices"} icon={"settings_ethernet"} />
            </Link>
            <Link to="/d">dd
                <NavBarItem name={"Areas"} icon={"room"} />
            </Link>
            <OldSchoolMenuLink to="/about" name={'About'}>
                <NavBarItem name={"About"} icon={"info"} />
            </OldSchoolMenuLink>

            {/* An <Outlet> renders whatever child route is currently active,
          so you can think about this <Outlet> as a placeholder for
          the child routes we defined above. */}
            <Outlet />
        </div>
    );
}

function OldSchoolMenuLink({ name, icon, to }) {
    const location = useLocation();
    const match = location.pathname === to;

    return (
        <div className="mdc-list-item" aria-current="page">
            <i className="material-icons mdc-list-item__graphic" aria-hidden="true">
                {'this.props.icon'}
            </i>
            <span className="mdc-list-item__text"> {'this.props.name'} </span>
        </div>
    );
}

function Home() {
    return (
        <div>
            <h2>Home</h2>
        </div>
    );
}

function About() {
    return (
        <div>
            <h2>About</h2>
        </div>
    );
}

function Dashboard() {
    return (
        <div>
            <h2>Dashboard</h2>
        </div>
    );
}

function NoMatch() {
    return (
        <div>
            <h2>Nothing to see here!</h2>
            <p>
                <Link to="/">Go to the home page</Link>
            </p>
        </div>
    );
}

export default NavBar;
